script: |
  super -f text -I q1532.spq | sort > q1532.out

inputs:
  - name: q1532.spq
    data: |
      SELECT col1 + + col2 / + col0 - tab0.col2 FROM tab0 (FORMAT parquet) WHERE NOT NULL NOT BETWEEN - col1 AND tab0.col2 - col0 * - col0 * + col0;
  - name: tab0

outputs:
  - name: q1532.out
    data: |
